import React from 'react';
import './App.css';
import Movie from './Movie'

const movieTitles = [
	"Matrix",
	"Identity",
	"Man From Earth",
	"Avengers"
]

const movieImages = [
	"https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwjhkuSzpfXhAhUbfnAKHV9gCtQQjRx6BAgBEAU&url=http%3A%2F%2Fblog.daum.net%2F_blog%2FBlogTypeView.do%3Fblogid%3D0C5P1%26articleno%3D17974856%26categoryId%3D379762%26regdt%3D20100625125200&psig=AOvVaw2QXquaMp150vSokEGBMEp9&ust=1556626946541566",
	"https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwipwLvXpfXhAhWXc3AKHaVwBoYQjRx6BAgBEAU&url=http%3A%2F%2Fm.blog.naver.com%2Fbeauty_sura%2F221239117249&psig=AOvVaw1JWJH-KkMyhOpnwXleHeoq&ust=1556627020978115",
	"https://www.google.com/imgres?imgurl=http%3A%2F%2Fblogthumb2.naver.net%2F20160107_38%2Fgenesis0821_1452137767329VBoXv_JPEG%2FScreenshot_2016-01-06-12-16-08-1.jpg%3Ftype%3Dw2&imgrefurl=http%3A%2F%2Fblog.naver.com%2FPostView.nhn%3FblogId%3Dgenesis0821%26logNo%3D220591687646&docid=Jji2cnxk8JodtM&tbnid=JyuxGhhKZLfrzM%3A&vet=10ahUKEwjHiOXbpfXhAhWTfd4KHfExBX0QMwg-KAAwAA..i&w=740&h=1053&bih=841&biw=1491&q=%EB%A7%A8%ED%94%84%EB%A1%AC%EC%96%B4%EC%8A%A4&ved=0ahUKEwjHiOXbpfXhAhWTfd4KHfExBX0QMwg-KAAwAA&iact=mrc&uact=8",
	"https://www.google.com/imgres?imgurl=https%3A%2F%2Fw.namu.la%2Fs%2F0d29e9a0193dfa14ac8cfa0b6281438bb10eadd53f92b3567172df665c831966468bc491c4a18d23b282cf7d655a49ff0c5c1fb0015100a6dfd852f2d896fc70128c730378603086e210c5ed48a80b30be3d5bc248c02fd03a00ecb203600407&imgrefurl=https%3A%2F%2Fnamu.wiki%2Fw%2F%25EC%2596%25B4%25EB%25B2%25A4%25EC%25A0%25B8%25EC%258A%25A4%3A%2520%25EC%259D%25B8%25ED%2594%25BC%25EB%258B%2588%25ED%258B%25B0%2520%25EC%259B%258C&docid=Rdj1M11HMyPfjM&tbnid=9Tuot4OjKS_2AM%3A&vet=10ahUKEwi5y8jxpfXhAhWJGaYKHbJpCLwQMwijASgAMAA..i&w=1000&h=1433&bih=841&biw=1491&q=%EC%96%B4%EB%B2%A4%EC%A0%B8%EC%8A%A4&ved=0ahUKEwi5y8jxpfXhAhWJGaYKHbJpCLwQMwijASgAMAA&iact=mrc&uact=8"
]

function App() {
  return (
    <div className="App">
      <Movie title={movieTitles[0]} poster={movieImages[0]}/>
			<Movie title={movieTitles[1]} poster={movieImages[1]}/>
			<Movie title={movieTitles[2]} poster={movieImages[2]}/>
			<Movie title={movieTitles[3]} poster={movieImages[3]}/>
    </div>
  );
}

export default App;
